import React from 'react';
import { useLocation } from 'react-router-dom'

const ConfirmRegister = () => {
  const location = useLocation();
  const { message } = location.state.registermessage;

  return (
    <div>
      <h1>Confirmation</h1>
      <p>{message}</p>
    </div>
  );
};

export default ConfirmRegister;
